window.bookSummaryJSON = "<p><i>Ready Player One</i> meets <i>Halo</i>&nbsp;</p> <p>Imprisoned for a murder he didn't commit, Kaiden's only hope of early release is in serving as a Warden in the game world of <i>Nova Online</i>.&nbsp;&nbsp;</p> <p>Playing as a unique class while surrounded by aliens, pirates and warring guilds, he and his squad are tasked with protecting new players and enforcing the rule of law.&nbsp;&nbsp;</p> <p>But Kaiden has other ideas; he is intent on proving his innocence. The keys to his freedom lie hidden in the game's seedy underbelly. And as he'll soon discover, the bloody trail that led to his arrest is more twisted than he could have ever imagined.</p>"; 
